(707, 'Em Atendimento', '2023-11-27 09:04:29', 202, 14, 'Inicializado as 09:04:29 hs. do dia 27-11-2023', '2023-11-27 09:04:29', NULL),
(708, 'Finalizado', '2023-11-27 09:07:34', 202, 14, 'Constatamos uma intermitência nas redes wifi da unidade, conforme relatado pelo cliente. Após realizarmos alguns testes, conseguimos identificar que vários Access Point\'s estavam propagando sua própria rede wifi de forma independente (usuário x e y se conectavam no mesmo SSID \"Vamos Sorrir\", mas cada um estava acessando uma rede diferente), causando um mal funcionamento da rede pelo fato de não ter uma gerência centralizada. Neste cenário, o ideal é que todos os AP\'s estejam propagando a mesma rede com apenas uma gerência para não causar conflitos. Também observou-se que uma das redes de internet da unidade não estava funcionando. \r\nSoluções:\r\n Instalado uma controladora para gerenciar as redes wifi de forma centralizada nos AP\'s da Ubiquiti;\r\nReset os AP\'s da Intelbras e reconfigurá-los novamente um por um.\r\n', '2023-11-27 09:07:34', NULL),
(709, 'Em Atendimento', '2023-11-27 09:07:57', 282, 14, 'Inicializado as 09:07:57 hs. do dia 27-11-2023', '2023-11-27 09:07:57', NULL),
