(769, 'Finalizado', '2023-12-01 11:41:49', 166, 131, 'Foi feito a instalação da máquina nova no local da antiga e estava funcionando normalmente, com o Windows e alguns programas baixados, só foi realizado a instalação do Ecuro, AnyDesk, Chrome e Adobe PDF.', '2023-12-01 11:41:49', NULL),
(770, 'Pausado', '2023-12-01 14:12:30', 360, 131, 'Chegando à Instituição, fui olhar os computadores com problemas. O primeiro computador, que foi o novo, a auxiliar relatou que estava sem S.O, mas, ao inicializar, estava com S.O instalado, inclusive os pacotes offices, fiz a adição do Adobe PDF, AnyDesk e Chrome. (Chamado 360; 166)\r\nO segundo computador, estava ligando, porém a ventoinha não estava girando, assim o processador aquecia, desligando a máquina como uma forma de segurança.  (Chamado 164)\r\nO terceiro computador estava com o mesmo problema do segundo, sempre reiniciando, fiz uma limpeza na RAM, na ventoinha e, como último teste, mexi na fonte, contudo, nada aconteceu, ele continuou funcionando. Vale ressaltar que fiz uma observação de 20 minutos para ver se o computador iria desligar e ele prosseguiu trabalhando. (Chamado 163)\r\nO quarto computador apresentava o botão liga/desliga danificado, será necessário um novo gabinete.\r\nDepois de instalado o terceiro computador voltou a ficar com problema, fiz a analise novamente, já retirando a ventoinha e percebi que a pasta térmica estava ressecada, como não tinha o equipamento naquele momento, SERÁ NECESSÁRIO RETORNAR para executar o procedimento. (Chamado 163)', '2023-12-01 14:12:30', NULL),
