(823, 'Finalizado', '2023-12-15 09:47:32', 401, 14, 'Pacote office já estava instalado, porém, sem licença para funcionar.\r\nFeito a ativação do pacote office, limpeza de memoria e otimização de desempenho.', '2023-12-15 09:47:32', NULL),
(824, 'Em Atendimento', '2023-12-15 10:38:42', 402, 14, 'Inicializado as 10:38:42 hs. do dia 15-12-2023', '2023-12-15 10:38:42', NULL),
(825, 'Em Atendimento', '2023-12-15 10:50:04', 403, 14, 'Inicializado as 10:50:04 hs. do dia 15-12-2023', '2023-12-15 10:50:04', NULL),
(826, 'Em Atendimento', '2023-12-15 11:23:22', 385, 131, 'Inicializado as 11:23:22 hs. do dia 15-12-2023', '2023-12-15 11:23:22', NULL),
(827, 'Finalizado', '2023-12-15 11:32:53', 385, 131, 'Foi feito um atendimento remoto. Visando o problema, pedi para que ela tentasse ligar o computador com ele conetado direto na tomada, uma vez que ele estava conectado ao estabilizador. Ao conectar a máquina na tomada, ela funcionou normalmente. Pedi para ela fazer alguns testes com o estabilizador, retirando e conectando novamente da tomada e tentando ligar, mas o aparelho não ligava. Todas as explicações do problema foram passadas para a auxiliar (Kátyla) e ela está ciente.\r\n\r\nConclusão: Estabilizador queimou, terá que solicitar um novo.', '2023-12-15 11:32:53', NULL),
(828, 'Em Atendimento', '2023-12-15 12:44:41', 386, 131, 'Inicializado as 12:44:41 hs. do dia 15-12-2023', '2023-12-15 12:44:41', NULL),
(829, 'Finalizado', '2023-12-15 12:47:06', 386, 131, 'Foi passado algumas orientações para a auxiliar, com relação as máquinas lentas. Pedi para que ela acessar o gerenciador de tarefas e mostrasse as informações apresentadas. Finalizando esse processo, será necessário memórias e SSD. \r\nFoi verificado, também, o tipo de memória que será solicitado.\r\nPedido será feito em breve.', '2023-12-15 12:47:06', NULL),
(830, 'Em Atendimento', '2023-12-15 12:47:55', 243, 131, 'Inicializado as 12:47:55 hs. do dia 15-12-2023', '2023-12-15 12:47:55', NULL),
(831, 'Finalizado', '2023-12-15 12:48:31', 243, 131, 'Ao visitar a instituição, fiz a instalação do AnyDesk em todas as máquinas.', '2023-12-15 12:48:31', NULL),
(832, 'Em Atendimento', '2023-12-15 13:09:28', 382, 131, 'Inicializado as 13:09:28 hs. do dia 15-12-2023', '2023-12-15 13:09:28', NULL),
(833, 'Finalizado', '2023-12-15 13:17:33', 382, 131, 'Foi constatado o problema o qual computador não estava ligando. Foi feito a instalação da fonte que havia chegado na Instituição, após esse procedimento o computador normalizou (a fonte antiga estava com mal-contato, por isso teve que ser substituída). Foi relatado que um outro computador não estava dando vídeo, fiz uma limpeza na memória RAM, passei limpa contato e limpeza nos slot\'s. Quando liguei novamente, já estava dando vídeo.  Finalizando o serviço, passei tudo que foi feito para a auxiliar e aguardei a validação dela que veio com sucesso.', '2023-12-15 13:17:33', NULL),
(834, 'Em Atendimento', '2023-12-15 13:19:14', 396, 14, 'Inicializado as 13:19:14 hs. do dia 15-12-2023', '2023-12-15 13:19:14', NULL),
(835, 'Em Atendimento', '2023-12-15 13:19:38', 395, 14, 'Inicializado as 13:19:38 hs. do dia 15-12-2023', '2023-12-15 13:19:38', NULL),
