(846, 'Finalizado', '2023-12-18 14:48:33', 398, 14, 'Cooler não estava funcionando devido a fiação o prender. Com isso, a CPU esquentava e desligava. Colocado pasta térmica e arrumado os fios ao redor do cooler.', '2023-12-18 14:48:33', NULL),
