(860, 'Finalizado', '2023-12-19 11:10:19', 393, 14, 'Impressora não estava funcionando devido após a troca do tonner ele continuava dando a mensagem de substituição de tonner. \r\nFeito o reset do cilindro e ela voltou a imprimir.\r\nCompartilhado a impressora na rede e colocado os demais computadores para imprimir nela.', '2023-12-19 11:10:19', NULL),
