(876, 'Aguardando Cliente', '2023-12-20 10:59:48', 405, 13, 'enviado orçamento. ', '2023-12-20 10:59:48', NULL),
(877, 'Em Atendimento', '2023-12-20 13:46:06', 407, 131, 'Inicializado as 13:46:06 hs. do dia 20-12-2023', '2023-12-20 13:46:06', NULL),
(878, 'Finalizado', '2023-12-20 13:46:38', 407, 131, 'A auxiliar me apresentou dois problemas: Computadores que não se comunicam com a impressora e um computador que não liga.\r\nPara esse, foi feita a instalação dos drivers da impressora e drivers de scan. Ao reiniciar a máquina, elas já estavam comunicando normalmente e scaneando.\r\nPara este, foi feito a troca da pasta térmica que, a princípio, pensei que fosse o problema. No fim das contas, o problema era com a fonte que não estava passando carga para a placa. Realizei a troca dela, fiz alguns testes e pronto, a máquina já estava funcionando bem.\r\nVale ressaltar que a comunicação com a impressora foi feita também nessa máquina, totalizando 3/3 máquinas conectadas a impressora sendo 1/3 que precisei trocar a fonte.', '2023-12-20 13:46:38', NULL),
(879, 'Em Atendimento', '2023-12-20 14:35:17', 392, 14, 'Inicializado as 14:35:17 hs. do dia 20-12-2023', '2023-12-20 14:35:17', NULL),
(880, 'Finalizado', '2023-12-20 14:47:50', 392, 14, 'Feito acompanhamento do técnico da Algar que restabeleceu o link que estava sendo usado por outro serviço.', '2023-12-20 14:47:50', NULL),
(881, 'Finalizado', '2023-12-20 16:07:14', 417, 15, 'Chamado aberto junto a intelbras e foi identificado tentativa de invasão ao sistema foi feito uma aplicação de firewal que resolveu.', '2023-12-20 16:07:14', NULL),
(882, 'Em Atendimento', '2023-12-21 09:58:46', 415, 131, 'Inicializado as 09:58:46 hs. do dia 21-12-2023', '2023-12-21 09:58:46', NULL),
(883, 'Em Atendimento', '2023-12-21 10:47:52', 412, 131, 'Inicializado as 10:47:52 hs. do dia 21-12-2023', '2023-12-21 10:47:52', NULL),
(884, 'Finalizado', '2023-12-21 10:49:56', 412, 131, 'Ao chegar na Instituição, a responsável pelo computador disse que a máquina já havia voltado a funcionar normalmente. Visando isso, não precisei executar procedimento algum, apenas sugerir a hipótese de que o problema seja algo no servidor dos sites em que ela estava acessando.', '2023-12-21 10:49:56', NULL),
(885, 'Em Atendimento', '2023-12-21 10:50:24', 418, 131, 'Inicializado as 10:50:24 hs. do dia 21-12-2023', '2023-12-21 10:50:24', NULL),
(886, 'Pausado', '2023-12-21 10:52:55', 418, 131, 'Aluisia enviou-me um vídeo de como o problema está sendo apresentado (a tela fica escura e volta), acredito que seja problema no cabo VGA, de qualquer forma, uma visita terá que ser feita para que os testes sejam realizados.', '2023-12-21 10:52:55', NULL),
(887, 'Em Atendimento', '2023-12-21 10:56:17', 384, 131, 'Inicializado as 10:56:17 hs. do dia 21-12-2023', '2023-12-21 10:56:17', NULL),
(888, 'Pausado', '2023-12-21 11:13:52', 384, 131, 'Partindo dos pressupostos dissertados no chamado (a LED do Nobreak fica aceso na cor vermelha e que houve uma queda de energia devido as fortes chuvas) é possível presumir que o Nobreak sofreu um curto-circuito.', '2023-12-21 11:13:52', NULL),
(889, 'Em Atendimento', '2023-12-21 11:14:27', 419, 15, 'Inicializado as 11:14:27 hs. do dia 21-12-2023', '2023-12-21 11:14:27', NULL),
(890, 'Finalizado', '2023-12-21 14:53:27', 397, 131, 'No dia da visita, a primeira atividade que fiz foi a comunicação dos computadores com a impressora. Como de costume, baixei os drivers dela nos computadores e fiz os testes, que funcionaram com êxito. Essa primeira atividade dissertada parece ter sido rápido, mas levou alguns minutos, pois passei bastante tempo tentando comunicar as três máquinas quando me disseram que não precisava, bastava uma estar comunicando que estaria tudo certo.\r\nA segunda atividade que fiz foi ir ao Consultório 18 e verificar a falta de execução da máquina. Chegando lá, deparei-me com a seguinte cena: Computador estava na BIOS e não estava reconhecendo o SSD. Fiz a troca do cabo SATA, coloquei o Boot no SSD, salvei as alterações e reiniciei a máquina que ligou normalmente e já entrava no boot do Windows, solucionando, assim, o problema do Consultório 18.\r\nA terceira atividade que fiz foi ir no Consultório 17 que, na realidade, foi confundido com o Consultório 18 e, na verdade, o problema estava no Consultório 13/14/15. Analisando o problema, notei que seria a fonte e, paralelo a isso, tem a quarta atividade que seria verificar três máquinas que estavam paradas. Monique e a auxiliar, com a aprovação de Priscilla, passou-me a informação de que poderia utilizar as peças desses três computadores para acrescentar em máquinas que necessitavam de modificações que foi o caso do Consultório 13/14/15. Peguei a fonte de um dos três computadores que se encontravam na sala e coloquei no computador do local em questão, fazendo com que a máquina funcionasse normalmente trazendo alegria ao seu usuário.\r\n\r\n\r\nOBS.: Esqueci de fechar o bendito chamado, pois tive que sair com urgência para a unidade de Brotas.', '2023-12-21 14:53:27', NULL),
(891, 'Finalizado', '2023-12-21 14:55:21', 397, 131, '...E, por fim, coloquei a antena de internet no consultório 13/14/15, pois foi sinalizado pelo doutor que seria lá, mas a auxiliar desmentiu a situação e com ar cômico disse que iria pegar de volta e iria, ela mesma, colocar no local previsto a princípio.', '2023-12-21 14:55:21', NULL),
(892, 'Em Atendimento', '2023-12-22 10:35:04', 419, 131, 'Inicializado as 10:35:04 hs. do dia 22-12-2023', '2023-12-22 10:35:04', NULL),
(893, 'Finalizado', '2023-12-22 10:35:18', 419, 131, 'A auxiliar entrou em contato comigo e disse que o problema está nas tomadas, uma vez que ela tentou conectar algum aparelho e não passava rede elétrica. Pedi para que fosse feito um teste do computador em alguma tomada que esteja funcionando e o computador ligou. Desse modo, pedi lhe para entrar em contato com a assistência de energia elétrica para solucionar o problema das tomadas.', '2023-12-22 10:35:18', NULL),
(894, 'Em Atendimento', '2023-12-22 16:26:03', 421, 131, 'Inicializado as 16:26:03 hs. do dia 22-12-2023', '2023-12-22 16:26:03', NULL);
