(914, 'Em Atendimento', '2023-12-27 15:27:02', 425, 14, 'Inicializado as 15:27:02 hs. do dia 27-12-2023', '2023-12-27 15:27:02', NULL),
(915, 'Finalizado', '2023-12-27 15:30:11', 424, 14, 'Cabo de rede estava mal encaixado, após reconectar, impressora voltou a imprimir e scannear.', '2023-12-27 15:30:11', NULL),
(916, 'Finalizado', '2023-12-27 21:48:13', 426, 131, 'O Whatsapp que elas utilizam (Business), estava em um loop infinito de carregamento. Foi feito a exclusão do emulador de celular (BlueStack) o qual elas utilizavam para usar o Whatsapp Business, e instalado novamente. Esse processo resolveu o problema da atualização, como não havia backup no g-mail do Whatsapp Business, algumas conversas e mídias foram perdidas, mas nada que prejudicasse os funcionários. A validação foi feito com Cida e o atendimento finalizado.', '2023-12-27 21:48:13', NULL),
(917, 'Finalizado', '2023-12-27 22:02:44', 420, 131, 'O atendimento de São Cristóvão foi só deslocar os computadores de lugar, porém, houveram alguns imprevistos.\r\nPrimeiro foi tirado um computador da Orto e colocado no Consultório 06. O computador que foi dado como queimado, após ser plugado numa tomada de 220v estava funcionando normalmente. Este computador foi para o Consultório 06 e precisou de um Cabo VGA, mouse e teclado, os dois primeiros foram comprados na hora, o último a auxiliar responsabilizou em conseguir e plugar.\r\nFoi feito a troca do computado do Consultório 01 para o Consultório 09 e a instalação do Ecuro (Driver do leitor biomêtrico) no notebook do Doutor do Consultório 01.\r\nDois computadores da recepção estavam precisando de memória RAM, como tinha dois computadores parados no consultório 10, foi reaproveitado as memórias e a fonte, uma vez que a fonte do computador do Consultório 06 deu problema, das duas memórias que foram reaproveitadas uma estava ruim, a boa foi colocada no computador da auxiliar. O Slot do outro computador que precisou de memória está danificado, precisa comprar uma memória de 8GB mesmo.\r\nFoi feito a conexão dos computadores com a impressora da recepção que, também, foi solicitado.\r\nConcluído tudo isso, foi feito uma validação pela auxiliar e o atendimento concluído.\r\n\r\nA solicitação dos chamados para os problemas adicionais será feito para a auxiliar. Quando abertos irei concluir o atendimento colocando a numeração desse histórico como referência, uma vez que o histórico já estará salvo nesse chamado.', '2023-12-27 22:02:44', NULL),
(918, 'Em Atendimento', '2023-12-28 09:04:58', 430, 14, 'Inicializado as 09:04:58 hs. do dia 28-12-2023', '2023-12-28 09:04:58', NULL),
(919, 'Em Atendimento', '2023-12-28 09:41:46', 415, 131, 'Inicializado as 09:41:46 hs. do dia 28-12-2023', '2023-12-28 09:41:46', NULL),
(920, 'Finalizado', '2023-12-28 10:20:04', 415, 131, 'O computador do consultório 01 estava muito lento, segundo o chamado. Fiz a análise do sistema e a memória estava insuficiente para os processos que estavam sendo feitos na máquina. Foi solicitado uma memória RAM de 8GB, como há computadores que foram condenados, pedi para a auxilicar me indicar o local onde estavam eles para que eu pudesse aproveitar a memória, ela me sinalizou e fui até o local onde pude encontrar 5 computadores parados, dos 5 apenas 3 possuiam memória. Peguei as 3 memórias e fui testar na máquina do consultório 01. Após colocar a memória, ela funcionou normal, deixando a máquina com 16GB de RAM, as memórias que sobraram foram colocadas de volta ao local as que peguei. Assim finalizo o atendimento.', '2023-12-28 10:20:04', NULL),
(921, 'Em Atendimento', '2023-12-28 11:18:39', 436, 15, 'Inicializado as 11:18:39 hs. do dia 28-12-2023', '2023-12-28 11:18:39', NULL),
(922, 'Em Atendimento', '2023-12-28 11:19:08', 437, 15, 'Inicializado as 11:19:08 hs. do dia 28-12-2023', '2023-12-28 11:19:08', NULL),
(923, 'Em Atendimento', '2023-12-28 13:21:58', 418, 131, 'Inicializado as 13:21:58 hs. do dia 28-12-2023', '2023-12-28 13:21:58', NULL),
(924, 'Em Atendimento', '2023-12-28 14:06:18', 438, 15, 'Inicializado as 14:06:18 hs. do dia 28-12-2023', '2023-12-28 14:06:18', NULL),
(925, 'Finalizado', '2023-12-28 15:05:04', 418, 131, 'O computador fica travando e a tela fica escura, fiz teste de cabo e o problema persistiu. Analisando o desempenho da RAM, pude notar que o sistema, sem programa algum executando, já estava sobrecarregado, uma vez que a memória do programa está rodando em 3,9GB.\r\nTerá que ser feito pedido de RAM de 8GB', '2023-12-28 15:05:04', NULL),
(926, 'Finalizado', '2023-12-28 17:06:12', 430, 14, 'Instalado as atualizações pendentes do ssitema operacional e whatsApp voltou a funcionar. ', '2023-12-28 17:06:12', NULL),
