(943, 'Em Atendimento', '2024-01-02 09:44:19', 442, 15, 'Inicializado as 09:44:19 hs. do dia 02-01-2024', '2024-01-02 09:44:19', NULL),
(944, 'Finalizado', '2024-01-02 09:45:10', 442, 15, 'Liguei o telefone estava funcionando normalmente.', '2024-01-02 09:45:10', NULL),
(945, 'Em Atendimento', '2024-01-02 09:46:17', 428, 131, 'Inicializado as 09:46:17 hs. do dia 02-01-2024', '2024-01-02 09:46:17', NULL),
(946, 'Em Atendimento', '2024-01-02 09:46:39', 429, 131, 'Inicializado as 09:46:39 hs. do dia 02-01-2024', '2024-01-02 09:46:39', NULL),
(947, 'Finalizado', '2024-01-02 09:52:22', 436, 131, 'Foi feito uma análise me duas impressoras na Unidade de Paripe. A primeira impressora foi colocada para funcionar por um rapaz que foi lá para recarregar o cartucho, vale ressaltar que quando cheguei ele já estava lá. A segunda impressora estava com problema no fechamento em duas bandejas e problema quando ela puxa o papel para imprimir o verso.  A primeira impressora também está com problema no Scanner, que só foi me informado depois, uma led queimou e parte da imagens copiadas não saem. Conectei o Scanner numa terceira impressora como improviso até a liberação da segunda impressora, após isso, será necessário a correção na segunda impressora.\r\n', '2024-01-02 09:52:22', NULL),
(948, 'Em Atendimento', '2024-01-02 10:34:02', 443, 14, 'Inicializado as 10:34:02 hs. do dia 02-01-2024', '2024-01-02 10:34:02', NULL),
(949, 'Finalizado', '2024-01-02 11:13:50', 443, 14, 'Computador dando tela azul, feito a limpeza da memoria e voltou a funcionar.', '2024-01-02 11:13:50', NULL),
(950, 'Em Atendimento', '2024-01-02 13:57:24', 444, 14, 'Inicializado as 13:57:24 hs. do dia 02-01-2024', '2024-01-02 13:57:24', NULL),
