(952, 'Finalizado', '2024-01-02 15:12:18', 444, 14, 'Boatão do gabinete quebrado, ensinado a utilizar um objeto para pressionar o local de ligar até a troca do gabinete.', '2024-01-02 15:12:18', NULL),
(953, 'Finalizado', '2024-01-02 15:39:18', 445, 15, 'Chamado aberto junto a vivo que fez o reparo remotamente após isso liguei no contato da clinica e fui informado que estava normalizado o serviço.', '2024-01-02 15:39:18', NULL),
(954, 'Pausado', '2024-01-02 15:58:11', 425, 14, 'HD queimado, não reconhece na BIOS.\r\nNecessário a compra de um SSD para substituição.\r\n', '2024-01-02 15:58:11', NULL),
(955, 'Finalizado', '2024-01-03 07:01:37', 428, 131, 'Devido a grande quantidade de sujeiro localizada na ventoinha, ela não girava para fazer o resfriamento necessário, o processador esquentava e a máquina desligava e não iniciava mais. Desse modo, foi feito uma limpeza em toda a placa, colocado uma nova pasta térmica e limpeza na ventoinha, fiz alguns testes para saber se o problema iria retornar, entretanto, não voltou. \r\nAtendimento Finalizado.', '2024-01-03 07:01:37', NULL),
(956, 'Finalizado', '2024-01-03 07:07:39', 429, 131, 'O computador apresentava um estado exagerado de sujeira em toda a parte da placa-mãe. Realizei a limpeza dele, visto que o problema estava na memória RAM, passei o limpa contato e a borracha.Após todo o procedimento, o computador voltou a funcionar.\r\nFoi pedido para que seja feita a instalação de um computador no Consultório 04 e assim foi realizado.\r\nCris sinalizou um problema na outra unidade em Liberdade (COSB VIII), o computador corrompeu o SSD, precisando solicitar um novo, mas já havia um sobrando, nesse caso, só foi necessário fazer a instalação do Windows e dos programas básicos. ', '2024-01-03 07:07:39', NULL),
(957, 'Finalizado', '2024-01-03 07:08:07', 429, 131, '...Atendimento finalizado após a validação da auxiliar.', '2024-01-03 07:08:07', NULL),
(958, 'Em Atendimento', '2024-01-03 15:00:17', 447, 14, 'Inicializado as 15:00:17 hs. do dia 03-01-2024', '2024-01-03 15:00:17', NULL),
(959, 'Finalizado', '2024-01-03 15:06:26', 447, 14, 'Em verificação do chamado, notou-se que o hub que fica na escritório não chegava conexão de rede. Ao realizar o teste de internet em  um notebook, ele acessou normalmente. Então colocamos o ponto em outra porta do hub e ele funcionou. ', '2024-01-03 15:06:26', NULL),
(960, 'Em Atendimento', '2024-01-03 15:22:10', 446, 131, 'Inicializado as 15:22:10 hs. do dia 03-01-2024', '2024-01-03 15:22:10', NULL),
(961, 'Finalizado', '2024-01-03 15:22:41', 446, 131, 'O cabo de força estava desconectado.\r\nConectei e o computador voltou a funcionar.', '2024-01-03 15:22:41', NULL),
(962, 'Em Atendimento', '2024-01-03 15:28:37', 440, 14, 'Inicializado as 15:28:37 hs. do dia 03-01-2024', '2024-01-03 15:28:37', NULL),
(963, 'Finalizado', '2024-01-03 15:30:01', 440, 14, 'Email estava pedindo verificação em duas etapas e indo par o telefone do suporte técnico. Retirado essa função e cliente conseguiu acessar novamente o email. ', '2024-01-03 15:30:01', NULL),
(964, 'Em Atendimento', '2024-01-04 07:34:57', 441, 131, 'Inicializado as 07:34:57 hs. do dia 04-01-2024', '2024-01-04 07:34:57', NULL),
(965, 'Finalizado', '2024-01-04 07:35:03', 441, 131, 'Entramos em contato com Dalva e ela mencionou que o primeiro monitor queimou, porém o segundo, voltou a funcionar após mexer no cabo de força. Desse modo, chegamos a conclusão que ele não estava conectado corretamente, uma vez que o monitor se manteve linear após a conexão correta do cabo de força.', '2024-01-04 07:35:03', NULL),
(966, 'Em Atendimento', '2024-01-04 09:23:40', 449, 14, 'Inicializado as 09:23:40 hs. do dia 04-01-2024', '2024-01-04 09:23:40', NULL),
(967, 'Finalizado', '2024-01-04 09:32:15', 449, 14, 'Técnico da operadora restou o modem e foi atribuído o IP de fabrica.\r\nEsse IP estava entrando em conflito com a RB que faz o gerenciamento da rede.\r\nFeito a substituição do IP para um diferente da RB e internet voltou a funcionar.', '2024-01-04 09:32:15', NULL),
