(1039, 'Finalizado', '2024-01-09 15:46:43', 457, 131, 'O computador não estava reconhecendo o USB do leitor, eu não sei uma palavra curta para dizer exatamente o que eu fiz, mas foi o seguinte:\r\nColoquei o arquivo do Ecuro na máquina e instalei os drivers, como ele não estava reconhecendo o aparelho, ficou pedindo para reconectar, eu reconectava e conectava novamente, ele continuava sem reconhecer e apresentava uma mensagem. Curioso pela mensagem, habilitei uma opção chamada: \"Device (sei lá o que) Tool\" ( Acredito eu que entrei na configuração/ferramenta do dispositivo) e finalizei. Foi quando abriu uma aba pedindo para selecionar o dispositivo e habilitar, fui mexendo e fazendo alguns testes e nenhuma resultado foi encontrada, então, cliquei na opção \"Init\" e apareceu as informações do Hamster/Leitor que estava conectado, dei um \"Capture\" e ele começou a piscar, ou seja, deu certo, para ter certeza, olha o Finger para saber se havia gerado algum ID e, realmente, havia gerado.\r\nFinalizado isso, solicitei para que ela abra um chamada para o pessoal que faz a configuração do leitor no site do Ecuro.', '2024-01-09 15:46:43', NULL),
(1040, 'Finalizado', '2024-01-09 16:21:01', 452, 131, 'Quando fui saber mais afundo sobre o problema, o Doutor informou-me que já havia resolvido e que se tratava do mouse, pois estava ruim.', '2024-01-09 16:21:01', NULL),
