(1053, 'Finalizado', '2024-01-10 12:31:23', 469, 131, 'Computador estava com a pasta térmica ressecada, realizei a troca dela e a limpeza da ventoinha, além da placa em si, passei um limpa contato para retirar sujeiras presentes nos conectivos da máquina.  \r\nA máquina ligou normalmente e está funcionando.', '2024-01-10 12:31:23', NULL),
