(1142, 'Finalizado', '2024-01-19 09:15:44', 506, 14, 'Consultório 17 e 01 estão com instabilidade de conexão devido a má qualidade da antena utilizada. Necessário a substituição dessas antenas e de outros 3 consutórios. \r\nComputador da recepção Orto não ligava devido sujeira no compartimneto da memória ram, após limpeza o equipamento voltou a funcionar.\r\nImpressora da recepção Orto não estava funcionando devido a impressora está numa outra faixa de ip, colocado na faixa de rede correta e o mesmo voltou a imprimir.\r\nDetectada que a rede Algar (internet principal), está com muita instabilidade de conexão, tendo quedas continuas.\r\nFeito abertura de chamada junto a operadora para verificar instabilidade.\r\nEnquanto a instabilidade não corrigida pela operadora, foi colocado a internet de backup para funcionar(Vivo).', '2024-01-19 09:15:44', NULL),
(1143, 'Em Atendimento', '2024-01-19 11:52:41', 491, 131, 'Inicializado as 11:52:41 hs. do dia 19-01-2024', '2024-01-19 11:52:41', NULL),
(1144, 'Finalizado', '2024-01-19 11:52:53', 491, 131, ' Foi feito uma análise nos computadores da recepção e consultórios.\r\nA princípio a auxiliar informou que precisava ver todos os computadores dos consultórios, porém, quando passei nas máquinas e perguntando aos doutores sobre as máquinas deles, eles informaram-me que não apresentavam problemas e que estavam funcionando bem, outros já relataram problemas desempenho e os computadores da recepção, todos, apresentaram pouco desempenho.\r\nOs computadores estavam precisando de upgrade nas memórias RAM\'s. Os computadores são:\r\nPara memórias normais DDR3 8GB de RAM - Consultório 05; Orto 08/09; Consultório 10; Consultório Av.02; Consultório Av.03.\r\nPara memórias de notebook DDR3 - Recepção 2Andar; Computador Prótese; 4 computadores da Recepção 01.\r\n\r\nTotalidade - 6 memórias de notebook DDR3 e 5 Memórias normais DDR3', '2024-01-19 11:52:53', NULL),
(1145, 'Em Atendimento', '2024-01-19 12:08:38', 474, 131, 'Inicializado as 12:08:38 hs. do dia 19-01-2024', '2024-01-19 12:08:38', NULL),
(1146, 'Finalizado', '2024-01-19 12:09:41', 474, 131, 'Entrei em contato com a auxiliar (Cida) e ela me informou que o problema foi resolvido ao reiniciar o computador/os computadores.\r\nCom isso, finalizo o atendimento.', '2024-01-19 12:09:41', NULL),
