(1341, 'Finalizado', '2024-02-02 10:51:54', 549, 131, 'O computador apresenta HD, necessário adquirir SSD para melhor desempenho da máquina. Pedi para a auxiliar ver se consegue a peça via local, caso não consiga, orientei ela a me avisar para que seja feito o pedido on-line.', '2024-02-02 10:51:54', NULL),
