(1574, 'Finalizado', '2024-03-07 12:50:12', 572, 131, 'As peças foram solicitadas e enviadas para Priscilla. As peças já chegaram e foram instaladas (Memória Ram e SSD), nenhum arquivo foi perdido durante a passagem do HD para SSD, a doutora do Raio-X fez até um teste e estava tudo em ordem. \r\nHá dois computadores parados no Consultório 10, foi feito uma análise e, para colocar eles para funcionarem, são necessários: Duas fontes ATX; Duas memórias ram\'s de 8GB e dois SSD\'s. Essas peças já foram passadas para Priscilla, a análise estava sendo realizada no Consultório do Raio-X, após finalizar, fui colocar as peças no Consultório 10, uma doutora, que tem as chaves, disse que eu poderia deixar na frente da porta que ela iria guardar, contudo, não o fiz e coloquei numa sala de fronte ao consultório 10, sala essa que a doutora fica para que ela não se esqueça. Com tudo finalizado, atendimento foi fechado.', '2024-03-07 12:50:12', NULL),
(1575, 'Em Atendimento', '2024-03-07 12:50:45', 548, 131, 'Inicializado as 12:50:45 hs. do dia 07-03-2024', '2024-03-07 12:50:45', NULL),
