(1581, 'Finalizado', '2024-03-08 13:17:27', 596, 131, 'No consultório 4 estavam 6 computadores que pertenciam ao consultório 5; 7; 4; recepção de cima; recepção do térreo e o computador do Consultório 18/19. Todos apresentavam problemas, assim, foi feito uma análise geral das máquinas para saber quasi estavam boas e quais não estavam. Para não perder tempo, fiz uma limpeza geral em todos os computadores e conectei as fontes que estavam boas em seus respectíveis donos, dos seis computadores parados, cinco funcionaram, sendo que um precisou comprar uma fonte ali mesmo. Os computadores foram distribuídos para: Recepção de cima; recepção térreo, Consultório 4; Consultório 15/16; Consultório 7, o sexto computador estava com a placa danificada e será necessário adquirir o kit upgrade para que funcione. Vale ressaltar que foi pedido para as máquinas citadas, memórias ram\'s e SSD\'s, pois elas apresentavam baixo desempenho.', '2024-03-08 13:17:27', NULL),
