(1827, 'Pausado', '2024-04-02 10:13:01', 719, 131, 'A auxiliar acreedita que o problema esteja no toner. Ela solicitou a troca da peça e está esperando retorno, assim pediu para que o chamado fosse pausado até a peça ser trocada.', '2024-04-02 10:13:01', NULL),
(1828, 'Finalizado', '2024-04-02 17:15:48', 716, 131, 'Computador do consultório 08 precisava de limpeza nos periféricos e assim foi feito, assim como troca de pasta térmica ( Enfim, um checkup geral). Necessidade de atualizações do S.O que foi realizada instantes depois. Testes foram feitos e o computador está funcionando.\r\nComputador da recepção da orto está com problema na placa-mãe, substituição foi feito por uma placa que estava em um computador parado, solicitação da peça será encaminhada para Priscila. Vale ressaltar que foram colocadas SSD\'s nesse computador e no Consultório 17, procedimento que ficou pendente na visita anterior.', '2024-04-02 17:15:48', NULL),
(1829, 'Em Atendimento', '2024-04-02 17:30:04', 725, 131, 'Inicializado as 17:30:04 hs. do dia 02-04-2024', '2024-04-02 17:30:04', NULL),
