(1843, 'Finalizado', '2024-04-04 15:08:01', 727, 15, 'Realizado a reinstalação do driver de impressora em 3 maquinas onde após isso foi possivel realizar o scanner.', '2024-04-04 15:08:01', NULL),
(1844, 'Finalizado', '2024-04-04 16:41:40', 730, 131, 'Computador apresentava lentidão e travamento, por isso foi realizado uma limpeza nos periféricos e na memória RAM, limpeza de disco e a formatação.\r\n\r\nCom relação a formatação: \r\nFormatei o computador que, a princípio, a doutora me disse que não havia problema em formatar,  logo prosseguir na operação, até que a auxiliar chegou a instituição, quando comentei sobre formatar o computador ela disse que não era para realizar esse procedimento, pois havia coisas importantes na máquina. Contudo, eu já tinha formatado. Quando a doutora se apresentou no Consultório, questionei sobre a situação e ela disse-me que não havia problema e que ela própria já havia excluído várias arquivos. Ao repassar a situação para a auxiliar, ela disse que estava tranquilo. Sendo assim, dei continuidade no atendimento.\r\nVale ressaltar que nessa ínterim, foi feito uma busca de programas que restauram arquivos perdidos, mas sem sucesso com a busca.', '2024-04-04 16:41:40', NULL),
