(1939, 'Finalizado', '2024-04-15 15:42:44', 766, 131, 'Quando cheguei fui até o último andar, pois pensei que o atendimento fosse no escritório, enquanto esperava a resposta de Priscila, a recepcionista pediu para eu cadastrar o leitor biométrico no computador dela, assim o fiz, passando a orientação sobre o registro na página do Ecuro. Logo em seguida, Priscila me responde, dizendo que Emanuelly sabe do que se trata do chamado, então, fui até ela. Ao chegar na recepção e indaga-lá não entendi muito bem a situação, ela disse que gostaria de colocar Whatsapp Business no computador, mas entregou-me um chip de celular. Após entrar em contato com Diego, ele explicou-me do que se tratava e passou algumas orientações. Fui até o computador que deveria ser instalado o Whatsapp Business, aproximando-me da sala onde estava o computador, ele não se encontrava, a sala estava em reforma e o computador estava do lado de fora e desmontado, tive que monta-lo na mesma sala em que ele estava. Após fazer a montagem, fui instalar o programa que Diego havia indicado (BlueStacks) para colocar Whatsapp Business. O primeiro erro que apareceu foi uma solicitação do aplicativo para ativar um modo no computador em que ele (o aplicativo) seria executado; o passo a passo constava restaurar o computador; entrar na bios, ativar o modo (não lembro qual) e reinstalar o programa. Parecia ser um processo demorado, então optei por baixar um outro programa, o Nox que, logo em seguida, demonstrou ser mais complicado que o BlueStacks. O aplicativo demora para executar e, às vezes, não iniciava. De volta ao BlueStacks, decidi realizar os procedimentos que o aplicativo indicava e assim foi feito, estudei as possibilidades de executa-lo, encontrando um site que ensinava uma maneira mais rápida, sem precisar restaurar o computador.\r\nDurante o procedimento, a demora de instalação do aplicativo era absurda, fiz algumas limpezas no computador e verificação com a rede, tudo estava normal, o programa que estava lento mesmo, mas instalou.\r\nCom o Whatsapp Business instalado, faltava colocar o chip em algum celular; tentei o celular da auxiliar e o chip não foi reconhecido, pedi para que ela reiniciasse o aparelho, mesmo assim, nada adiantou. Pedi para que aguardassemos alguns minutos, pois um SMS deveria ser enviado.\r\nOs minutos se passaram e não avançamos no processo, tentei com o meu celular na esperança de funcionar e, novamente, não funcionou. Nessa altura, até a funcionário que dá assistência aos clientes chegou para ajudar. Pensamos que o problema fosse no chip, mas nada tudo indicativa que não fosse. Havia um celular parado com Emanuelle, então sugeri testar nele, porém estava descarregado, colocamos para carregar e isso levou mais alguns minutos. \r\nVale Ressaltar que durante esse tempo, Emanuelle atendia alguns pacientes e eu procurava alguma coisa na internet para solucionar o problema e os métodos que encontrava não funcionavam.\r\nCom o celular já carregado, colocamos o chip para testar. Dessa vez, tornou-se possível realizar o cadastro da linha - Emanuelly ficou responsável por adicionar os dados - mas o número do celular não foi disponibilizado, de qualquer forma, entrei no aplicativo como quem vai fazer uma recarga e peguei o número que apresentava no site (NÂO FIZ RECARGA) e liguei do meu celular, o número era aquele, contudo, aceitava ligação e não SMS.\r\nDe volta ao Whatsapp Business, solicitei que ligasse para pegar o código de verificação, depois de alguns minutos, a ligação funcionou, pois, outrora não estava funcionando. Finalmente consegui cadastrar o Whatsapp Business no computador indicado e foi validade por Emanuelle.\r\nOBS.: Por mais que digitando pareça ser rápido e pareça ser uma tarefa simples, foi um processo bem demorado que nem a auxiliar acreditou - muito menos eu -, bom que foi resolvido. Fiz questão de detalhar cada momento, porque o que faz com que a gente demore em um processo não é a situação, mas o fato de precisar estudar o problema para depois solucionar. Como foi o caso das instruções do BlueStacks, eu precisava saber o que se tratava para não está executando um procedimento que vá prejudicar a máquina, ou o fato do erro do chip que precisei pesquisar e estudar o erro para saber como solucionar. De qualquer forma, deu tudo certo.\r\n', '2024-04-15 15:42:44', NULL),
