(1982, 'Finalizado', '2024-04-19 11:00:38', 722, 131, 'Computador estava conectado à um T defeituoso que causava queda de energia na máquina, antecedidos de breves estalos localizado na conexão entre fonte e cabo de força devido a má conexão com o T. \r\nA recomendação foi utilizar uma extensão em vez de T. Dito isso, Encontramos uma guardada nas gavetas da recepção segundo andar.\r\nA extensão foi levada após a aprovação da auxiliar do uso dela. Assim o computador foi montado e testado.\r\nEstá funcionando.\r\n', '2024-04-19 11:00:38', NULL),
