(1990, 'Pausado', '2024-04-22 17:17:21', 803, 14, 'Feito a abertura de chamado junto a Mobit. Chamado registrado sob n° 202404228042206.\r\nEstamos pesquisando empresas de internet fibra ótica para contratação.', '2024-04-22 17:17:21', NULL),
(1991, 'Pausado', '2024-04-22 17:22:23', 788, 14, 'Em um suporte remoto realizado na unidade da Vamos Sorrir em Cruz das Almas, reconfiguramos o roteador de borda TPLink e os 2 AP\'s ubiquiti para acessos das redes Wifi na unidade. Também fizemos uma análise técnica, identificando alguns problemas que estão ocasionando lentidão na rede.\r\nTambém será necessário a substituição de alguns adaptadores wifi e a instalação do mikrotik para a redundância  de rede.\r\n\r\nSendo assim, é necessário a realização de uma visita in loco para uma melhor análise da unidade, identificando os pontos de gargalo na rede e também para que se tenha uma melhor entendimento sobre a topologia atual da unidade. Com base nesse diagnóstico, podemos sugerir as possíveis melhorias que a unidade pode está adotando, visando mitigar os problemas apresentados\r\n', '2024-04-22 17:22:23', NULL),
