(2014, 'Aguardando Cliente', '2024-04-25 13:25:51', 798, 14, 'Identificado problema na central telefônica. Central configurada com duas linhas externas quando um atendente está usando uma linha, ninguém consegue fazer e nem receber ligação. Feito o procedimento de reset e troca de slot dos troncos e erro não foi solucionado. Defeito na central telefônica. \r\nNecessário a substituição da central e contratação para instalação, ou a colocação da tecnologia de telefonia por ip (wid voice).', '2024-04-25 13:25:51', NULL),
