(2030, 'Finalizado', '2024-04-30 12:10:20', 821, 131, 'Computador da recepção 2 (005140) apresentava ausência dos drivers da impressora. Sendo assim, foram baixados para que seja feito a realização da impressão e escaneamento.\r\nProcesso executado com sucesso e validado pela recepcionista e auxiliar.\r\n\r\nOBS.: Computador apresenta HD e memória de 4GB, necessário um SSD e uma memória de 8GB.', '2024-04-30 12:10:20', NULL),
(2031, 'Finalizado', '2024-04-30 12:17:48', 827, 131, 'Computador estava entrando na BIOS, pois o SSD não estava sendo identificado pela placa. Foi realizado uma limpeza geral na placa e testes de SATA, após isso, os equipamentos foram reequipados e iniciados, ao ligar o computador já estava acessando o Windows normalmente. Vale ressaltar a realização de otimização da máquina e limpezas básicas no software, como limpeza de cache, por exemplo.\r\nProcedimento validade pela auxiliar e doutora do consultório.', '2024-04-30 12:17:48', NULL),
(2032, 'Finalizado', '2024-04-30 12:20:13', 828, 131, 'Impressora configurada para escaneamento contínuo.\r\nProcedimento validado pela recepcionista e auxiliar.', '2024-04-30 12:20:13', NULL),
