(2098, 'Aguardando Comercial', '2024-05-10 21:48:23', 815, 271, 'Necessário visita técnica.', '2024-05-10 21:48:23', NULL),
(2099, 'Finalizado', '2024-05-11 01:55:57', 832, 131, 'Troca do cabo sata, pois estava folgado e cabo de força por conta da ferrugem. \r\nRecepção, 005283\r\n\r\n005286 troca pra a recepção, troca do cabo de força e limpeza básica.\r\n\r\n005276, limpeza na máquina e configuração do ecuro.\r\n\r\n005199 consultório 8\r\nMáquina não estava funcionando,  foi feita a limpeza das memórias e arquivos do sistema, configuração da impressora e do leitor de digital.', '2024-05-11 01:55:57', NULL),
(2100, 'Em Atendimento', '2024-05-13 10:13:38', 830, 131, 'Inicializado as 10:13:38 hs. do dia 13-05-2024', '2024-05-13 10:13:38', NULL),
(2101, 'Finalizado', '2024-05-13 10:14:20', 818, 131, 'Não foi a Sala Conforto, a sala em questão se trata do CRC.\r\nForam instaladas os cabeamentos de internet para essa sala e colocados os 7 pontos\r\nde internet. Foi colocado um AP no térreo para melhor alcance de internet e colocado\r\num AP na sala de reuniões para melhor conexão.', '2024-05-13 10:14:20', NULL),
(2102, 'Finalizado', '2024-05-13 10:21:21', 841, 131, 'Computador estava ligando, porém entrando na BIOS, o SSD não estava sendo reconhecido pela placa. Após realizar limpeza e substituição do cabo SATA, a máquina voltou a funcionar.', '2024-05-13 10:21:21', NULL),
(2103, 'Finalizado', '2024-05-13 10:26:39', 840, 131, 'Computador estava ligando, porém entrando na BIOS, o SSD não estava sendo reconhecido pela placa. Após realizar limpeza e substituição do cabo SATA, a máquina voltou a funcionar.\r\nDurante as atividades, Neto solicitou que fosse feita uma avaliação geral das máquinas paradas. Procedimentos realizados na unidade durante esse processo:\r\n\r\nComputador da recepção trocado para a prótese.\r\nConfiguração de impressora nos computadores da recepção;\r\nDrive do Ecuro no computador do Consultório 07/08;\r\nTroca de computador da recepção para o consultório 3;\r\nOtimização da máquina do Consultório 07/08;\r\nConfiguração do gmail na máquina da recepção;\r\nDrive de antena wi-fi e configuração do Ecuro no consultório 3.\r\n\r\nInfo. das máquinas paradas:\r\nComputador 005282 precisando de kit upgrade, problema na placa-mãe e fonte ATX bivolts;\r\nComputador sem numeração - problema na placa-mãe, SSD, Fonte ATX e Cooler necessita dessas peças. Já solicitadas para Priscila. (O kit upgrade vem com essas peças)\r\n', '2024-05-13 10:26:39', NULL),
(2104, 'Em Atendimento', '2024-05-13 11:09:22', 708, 131, 'Inicializado as 11:09:22 hs. do dia 13-05-2024', '2024-05-13 11:09:22', NULL),
(2105, 'Finalizado', '2024-05-13 11:10:10', 708, 131, 'Foi feita a avaliação e a máquina está funcionando em bom estado.', '2024-05-13 11:10:10', NULL),
(2106, 'Aguardando Comercial', '2024-05-13 11:18:24', 811, 131, 'A auxiliar relatou que o monitor não estava ligando, e que havia feito a troca por outro. Cujo o problema está descrito no chamado.\r\nFoi testado o monitor que ela disse que não estava ligando, porém estava em funcionamento. Então retiramos o monitor danificado e colocamos o monitor bom.\r\nO monitor que está danificado, não tem conserto. É necessário um novo monitor para a unidade.', '2024-05-13 11:18:24', NULL),
(2107, 'Em Atendimento', '2024-05-13 11:18:42', 811, 131, 'Inicializado as 11:18:42 hs. do dia 13-05-2024', '2024-05-13 11:18:42', NULL),
(2108, 'Finalizado', '2024-05-13 11:18:50', 811, 131, 'A auxiliar relatou que o monitor não estava ligando, e que havia feito a troca por outro. Cujo o problema está descrito no chamado.\r\nFoi testado o monitor que ela disse que não estava ligando, porém estava em funcionamento. Então retiramos o monitor danificado e colocamos o monitor bom.\r\nO monitor que está danificado, não tem conserto. É necessário um novo monitor para a unidade.', '2024-05-13 11:18:50', NULL),
(2109, 'Em Atendimento', '2024-05-13 11:25:28', 861, 131, 'Inicializado as 11:25:28 hs. do dia 13-05-2024', '2024-05-13 11:25:28', NULL),
(2110, 'Finalizado', '2024-05-13 11:25:44', 864, 131, 'Conectado com sucesso.', '2024-05-13 11:25:44', NULL),
(2111, 'Em Atendimento', '2024-05-13 11:26:12', 864, 131, 'Inicializado as 11:26:12 hs. do dia 13-05-2024', '2024-05-13 11:26:12', NULL),
(2112, 'Finalizado', '2024-05-13 11:28:53', 863, 131, 'Foi realizado uma limpeza na máquina, troca do cabo de força, troca do cabo SATA, limpeza na memória RAM. Após esses procedimentos o computador voltou a funcionar.\r\n\r\nOBS.: O consultório apresentava problemas na tomada, por isso, a máquina não foi conectada, pois haveria manutenção na rede elétrica.', '2024-05-13 11:28:53', NULL),
(2113, 'Em Atendimento', '2024-05-13 11:29:00', 863, 131, 'Inicializado as 11:29:00 hs. do dia 13-05-2024', '2024-05-13 11:29:00', NULL),
(2114, 'Finalizado', '2024-05-13 11:29:21', 862, 131, 'Problema estava na memória RAM. Após a limpeza, a máquina voltou a funcionar.', '2024-05-13 11:29:21', NULL),
(2115, 'Em Atendimento', '2024-05-13 11:58:02', 830, 131, 'Inicializado as 11:58:02 hs. do dia 13-05-2024', '2024-05-13 11:58:02', NULL),
(2116, 'Finalizado', '2024-05-13 11:58:27', 830, 131, 'Entrei em contato com a auxiliar (Emanuelle) e ela informou que já havia resolvido.', '2024-05-13 11:58:27', NULL),
(2117, 'Em Atendimento', '2024-05-13 11:59:04', 861, 131, 'Inicializado as 11:59:04 hs. do dia 13-05-2024', '2024-05-13 11:59:04', NULL),
(2118, 'Finalizado', '2024-05-13 11:59:54', 861, 131, 'Cabo de força estava danificado e a memória estava danificada. O cabo de força foi adquirida no momento do atendimento e a memória utilizada foi a que já estávamos em mãos. Feito limpeza nas duas máquinas da recepção, uma vez que foi reclamado lentidão em uma delas.', '2024-05-13 11:59:54', NULL),
(2119, 'Em Atendimento', '2024-05-13 13:51:30', 809, 14, 'Inicializado as 13:51:30 hs. do dia 13-05-2024', '2024-05-13 13:51:30', NULL),
(2120, 'Em Atendimento', '2024-05-13 15:15:59', 867, 271, 'Inicializado as 15:15:59 hs. do dia 13-05-2024', '2024-05-13 15:15:59', NULL),
(2121, 'Finalizado', '2024-05-13 15:16:49', 867, 271, 'Máquina não estava com office instalado, foi necessário fazer a instalação e ativação. O computador após reinicio apresentou tela azul, foi necessário restaurar o sistema operacional. Não foi perdido os arquivos e foi feita a reinstação dos programas essenciais incluindo o office. Após os precedimentos foi feita a ativação do office e do windows. Voltando o funcionamento padrão.\r\nOBS: Computador validado pela auxiliar. Os favoritos do google chrome foram perdidos, porém a mesma não viu problemas.', '2024-05-13 15:16:49', NULL),
(2122, 'Em Atendimento', '2024-05-13 16:13:17', 868, 271, 'Inicializado as 16:13:17 hs. do dia 13-05-2024', '2024-05-13 16:13:17', NULL);
