(2733, 'Aguardando Cliente', '2024-06-18 10:45:36', 1051, 271, 'Necessário a compra de um kit upgrade, o computador está com um processador antigo que gera gargalo. Será possível reutilizar o gabinte e a fonte.', '2024-06-18 10:45:36', NULL),
