(2747, 'Finalizado', '2024-06-19 11:46:07', 1022, 131, 'Dois computadores foram colocados para funcionar na unidade de Sussuarana.\r\nDevida a problemas relacionados com um computador da recepção (Fonte queimou) um dos computadores está sendo utilizado. O segundo computador está sendo utilizado no Atendimento Prótese, por solicitação do doutor. Assim como a aquisição de extensão e futuras de antena wifi e mouse, para melhor utilização da máquina.\r\nDoutor informou que entrará em contato com Priscila para solicitar leitor biométrico.\r\n\r\nConclusão: Máquinas funcionando e estão sendo utilizados na recepção e atendimento prótese.', '2024-06-19 11:46:07', NULL),
(2748, 'Em Atendimento', '2024-06-19 12:55:57', 1066, 17, 'Inicializado as 12:55:57 hs. do dia 19-06-2024', '2024-06-19 12:55:57', NULL),
