(2762, 'Em Atendimento', '2024-06-20 14:34:45', 1007, 271, 'Inicializado as 14:34:45 hs. do dia 20-06-2024', '2024-06-20 14:34:45', NULL),
(2763, 'Finalizado', '2024-06-20 14:35:03', 1007, 271, 'Foi feita a montagem das peças novas e configuração do sistema.', '2024-06-20 14:35:03', NULL),
(2764, 'Em Atendimento', '2024-06-20 14:45:24', 1076, 15, 'Inicializado as 14:45:24 hs. do dia 20-06-2024', '2024-06-20 14:45:24', NULL),
(2765, 'Em Atendimento', '2024-06-20 15:03:48', 1077, 271, 'Inicializado as 15:03:48 hs. do dia 20-06-2024', '2024-06-20 15:03:48', NULL),
(2766, 'Aguardando Cliente', '2024-06-20 15:03:54', 1077, 271, 'Consultório 1 - Troca do cabo sata, estava ruim.\r\nConsultório 2 - Computador não estava ligando e pela falta de cooler, foi colocado um cooler para a refrigeração do processador.\r\nConsultório 3 - O leitor está funcionando, porém o suporte do ecuro informou que não conseguiu resolver. Fiz a reinstalação do teamviewer para tentarem novamente.\r\nConsultório 5 - O ssd parou de funcionar. Então a solução encontrada foi pegar do ssd do consultório 10 (onde o computador queimou a fonte e ficará parado até a chegada das peças). O cabo de força também estava ruim, porém em outra visita solicitei pra que comprasse um cabo e deixasse de backup, o mesmo foi usado hoje, após os reparos voltou a funcionar. \r\nRecomendo a compra de um filtro de linha ou um estabilizador para evitar problemas como esse.\r\nConsultório 10 - Precisa comprar uma fonte, fui informado que a fonte pegou fogo e apesar de ligar não passa nenhuma voltagem. \r\nPrecisa também de um ssd, o mesmo foi para outro consultório pois estava sem.\r\nConsultório 16  - Troca do cabo sata e bateria da bios estava com baixa voltagem.\r\nPanorâmica - O leitor está funcionando, porém precisa abrir chamado no movidesk pra configurar o leitor no sistema ecuro.', '2024-06-20 15:03:54', NULL),
(2767, 'Em Atendimento', '2024-06-20 15:23:07', 1057, 271, 'Inicializado as 15:23:07 hs. do dia 20-06-2024', '2024-06-20 15:23:07', NULL),
(2768, 'Finalizado', '2024-06-20 15:24:18', 1057, 271, 'Após testes remoto com a auxiliar foi verificado que o problema era o adaptador wi-fi. A mesma também informou que compraria um novo no local. Sendo assim problema resolvido.', '2024-06-20 15:24:18', NULL),
(2769, 'Em Atendimento', '2024-06-21 08:18:32', 1076, 15, 'Inicializado as 08:18:32 hs. do dia 21-06-2024', '2024-06-21 08:18:32', NULL),
