(2779, 'Pausado', '2024-06-21 09:44:06', 1042, 131, 'Mobit informou que um técnico da Algar irá na unidade para resolver o problema de telefonia. Data: 21/06 entre às 9h e 12h.\r\nN°2024072792.', '2024-06-21 09:44:06', NULL),
